import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Route, Routes , Link} from "react-router-dom";
import './index.css';
import App from './App';
import SelectPanelPage from "./components/SelectPanelPage";
import RecentResults from "./components/results/RecentResults";

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
    <BrowserRouter>
        <Router>
            <ul className="App-header">
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/selectpanel">About Us</Link>
                </li>
            </ul>
            <div className={"text-5xl text-red-950 m-4 p-8"}>F1 Tracker</div>
            <Routes>
                <Route path="/selectpanel" element={<SelectPanelPage />}></Route>
                <Route path="/" element={<RecentResults />}></Route>
            </Routes>
        </Router>
        <App />
    </BrowserRouter>
);
